import React from "react";
import "./nav.css";

function Navegation(props) {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark">
        <img className="logo" src="logo.png" alt="Logo of the store"/>

        {/* <a href="#" class="btn btn-primary btn-lg active" role="button">Primary link</a> */}


        <div className="collapse navbar-collapse" id="navbarSupportedContent">
        <ul className="navbar-nav ml-auto">
                <li className="nav-item">
                    <button type="button" className="btn btn-success">Home</button>
                </li>
                <li className="nav-item active">
                    <button type="button" className="btn btn-primary">Products</button>
                </li>
            <li className="nav-item">
            <button type="button" className="btn btn-info">Contact</button>
            </li>
        </ul>

            <form className="form-inline my-2 my-lg-0 search-bar">
                <input className="input-space" type="text" id="prodInput" onkeyup="productSearch()" placeholder="Search for names.." title="Type in a name"/>
                <button className="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button>
            </form>
        </div>
        </nav> 
    );
    }

export default Navegation;
